import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Landing from './Landing';

function WebsiteRouter(){
    return (
        <Router>
            <Switch>
                <Route exact path='/' component={Landing} />
            </Switch>
        </Router>
    );
}

export default WebsiteRouter;
